window.bookSummaryJSON = "<p><b>He stole those who meant everything to me. </b></p> <p><b>I will hunt him down. I will lead him into the light. Into everlasting fire and torment. </b></p> <p>With Satan's escape the Circles are in chaos, ravaged by the Dragon's emergence. The Sword of Light was shattered. Lucifer and Vyra are gone. But this isn't the end.</p> <p>Not all of the demons in Dis are happy over the loss of their king. Assassins lurk in the shadows, and they're determined to ensure the Seventh Circle loses both of its princesses.</p> <p>With the help of a long-lost archangel who takes Tascius under his wing and Azazel's dark arts, we'll fend off the traitors and search to the end of the world to find our missing family. And when we do...all Hell will break loose.</p> <p><i>Contains mature themes.</i></p>"; 
